import React, { Component } from 'react';

import PlayerInfos from './PlayerInfos';
import FightButton from './FightButton';
import '../../styles/css/PlayersSelection.css';

class PlayersSelection extends Component {
  constructor(props) {
    super(props);

    this.state = {
      selectedP1: false,
      selectedP2: false,

      mapSelected: null
    };
  }

  render() {
    return (
      <div>
        <div className="charsSelection">
          <PlayerInfos />
          <div className="between_Players">
            <FightButton />
            <div id="vsLocation">
              <img
                src="https://files.slack.com/files-pri/T6SG2QGG2-FPBA02ARG/versus.gif"
                alt="VS"
                id="vsImage"
              />
            </div>
          </div>
          <PlayerInfos />
        </div>
      </div>
    );
  }
}

export default PlayersSelection;
